import { Button } from 'antd';
import React from 'react'
import {
    GithubOutlined,
    LinkedinOutlined,
    MailOutlined
} from '@ant-design/icons';


import './Home.scss';

export default function Home() {
    return (
        <div className='home' id='particles-js'>
            <div className='particles-js'>
                <h1>David DÃ­az</h1>
                <h2>Programador web</h2>
                <Button type='primary' className='btn-contact'>Contacta</Button>
                <div>
                    <ul>
                        <li><a href='https://github.com/DavidDiaz-github/' target='_blank'><GithubOutlined /></a></li>
                        <li><a href='https://www.linkedin.com/in/david-diaz-fueyo/' target='_blank' ><LinkedinOutlined /></a></li>
                        <li><a href='mailto:david1_43@hotmail.com'><MailOutlined /></a></li>
                    </ul>
                </div>
            </div>
            <div></div>
        </div>
    )
}

particlesJS("particle-container", {
    "particles": {
        "number": {
            "value": 80,
            "density": {
                "enable": true,
                "value_area": 800
            }
        },
        "color": {
            "value": "random"
        },
        "shape": {
            "type": "circle",
            "stroke": {
                "width": 0,
                "color": "#000000"
            },
            "polygon": {
                "nb_sides": 5
            },
            "image": {
                "src": "img/github.svg",
                "width": 100,
                "height": 100
            }
        },
        "opacity": {
            "value": 0.5,
            "random": false,
            "anim": {
                "enable": false,
                "speed": 1,
                "opacity_min": 0.1,
                "sync": false
            }
        },
        "size": {
            "value": 3,
            "random": true,
            "anim": {
                "enable": false,
                "speed": 40,
                "size_min": 0.1,
                "sync": false
            }
        },
        "line_linked": {
            "enable": false,
            "distance": 150,
            "color": "#ffffff",
            "opacity": 0.4,
            "width": 1
        },
        "move": {
            "enable": true,
            "speed": 1,
            "direction": "none",
            "random": false,
            "straight": false,
            "out_mode": "out",
            "bounce": false,
            "attract": {
                "enable": false,
                "rotateX": 600,
                "rotateY": 1200
            }
        }
    },
    "interactivity": {
        "detect_on": "canvas",
        "events": {
            "onhover": {
                "enable": false,
                "mode": "repulse"
            },
            "onclick": {
                "enable": false,
                "mode": "push"
            },
            "resize": true
        },
        "modes": {
            "grab": {
                "distance": 400,
                "line_linked": {
                    "opacity": 1
                }
            },
            "bubble": {
                "distance": 400,
                "size": 40,
                "duration": 2,
                "opacity": 8,
                "speed": 3
            },
            "repulse": {
                "distance": 200,
                "duration": 0.4
            },
            "push": {
                "particles_nb": 4
            },
            "remove": {
                "particles_nb": 2
            }
        }
    },
    "retina_detect": true
});
